import React from 'react'
import { user } from '../../data';
import './style.css';

function UserCard({userData}) {
  return (
    <div className='UserCard'>
      <img src={userData.avatar_url} alt="userAvatar" className='userAvatar'/>
      <br/>
      <div className="name">
      <h2>{userData.name}</h2>
      <h3>{userData.login}</h3>
      </div>
      <p className='card'>logo followers: <span>{userData.followers}</span> . following: <span>{user.following}</span></p>
    </div>
  )
}

export default UserCard
